import React, { useEffect, useState } from "react";
import "../Css/Dashboard.css";

function Dashboard() {
  const [user, setUser] = useState(null);
  const [crops, setCrops] = useState([]);

  useEffect(() => {
    const stored = JSON.parse(localStorage.getItem("userData"));
    if (stored) {
      setUser(stored);

      fetch(`http://localhost:9090/backend/api/crop/farmer?farmerId=${stored.farmerId}`)
        .then((res) => res.json())
        .then((data) => setCrops(data))
        .catch((err) => console.error("Failed to load crops", err));
    }
  }, []);

  const deleteCrop = (cropId) => {
    alert("Feature Coming Soon: Delete â†’ " + cropId);
  };

  const editCrop = (cropId) => {
    alert("Feature Coming Soon: Edit â†’ " + cropId);
  };

  return (
    <div className="dashboard-container">

      {/* Header */}
      <div className="dashboard-header">
        <h2>Welcome, {user?.fullName} ðŸ‘‹</h2>
        <p>Your farming insights and performance summary</p>
      </div>

      {/* Statistics Section */}
      <div className="dashboard-stats">
        <div className="stat-card">
          <i className="fa-solid fa-wheat-awn"></i>
          <h3>{crops.length}</h3>
          <p>Total Crops Listed</p>
        </div>

        <div className="stat-card">
          <i className="fa-solid fa-wallet"></i>
          <h3>â‚¹0</h3>
          <p>Total Earnings (Coming Soon)</p>
        </div>

        <div className="stat-card">
          <i className="fa-solid fa-chart-line"></i>
          <h3>Growing</h3>
          <p>Market Trends</p>
        </div>
      </div>

      {/* Bar Chart Visualization */}
      <div className="graph-section">
        <h3>Market Activity Overview</h3>

        <div className="graph-box">
          {crops.map((c, index) => (
            <div key={index} className="graph-bar">
              <div
                className="bar"
                style={{ height: `${Number(c.quantity) / 2}px` }}
              ></div>
              <span>{c.cropName}</span>
            </div>
          ))}

          {crops.length === 0 && <p className="no-graph">No data available</p>}
        </div>
      </div>

      {/* Crop List Table */}
      <div className="dashboard-section">
        <h3>Your Crop Listings</h3>

        <table className="crop-table">
          <thead>
            <tr>
              <th>Image</th>
              <th>Crop</th>
              <th>Category</th>
              <th>Qty</th>
              <th>Price</th>
              <th>Actions</th>
            </tr>
          </thead>

          <tbody>
            {crops.length === 0 ? (
              <tr>
                <td colSpan="6" style={{ textAlign: "center", padding: "20px" }}>
                  No crops posted yet.
                </td>
              </tr>
            ) : (
              crops.map((c, index) => (
                <tr key={index}>
                  <td>
                    <img
                      src={c.images ? `/uploads/${c.images}` : "/Images/noimg.png"}
                      alt="crop"
                      className="crop-img"
                    />
                  </td>
                  <td>{c.cropName}</td>
                  <td>{c.category}</td>
                  <td>{c.quantity} kg</td>
                  <td>â‚¹{c.price}</td>

                  <td>
                    <button className="edit-btn" onClick={() => editCrop(c.cropId)}>
                      <i className="fa-solid fa-pen-to-square"></i>
                    </button>

                    <button className="delete-btn" onClick={() => deleteCrop(c.cropId)}>
                      <i className="fa-solid fa-trash"></i>
                    </button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>

    </div>
  );
}

export default Dashboard;
